DROP TABLE IF EXISTS `busi_camera_point`;
CREATE TABLE `busi_camera_point`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '位点ID',
  `install_id` bigint NOT NULL COMMENT '归属项目ID(关联install表)',
  `site_code` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '位点编号(如H21-1)',
  `longitude` decimal(10, 7) NOT NULL COMMENT '经度',
  `latitude` decimal(10, 7) NOT NULL COMMENT '纬度',
  `altitude` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '海拔',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 305 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '红外相机位点信息表';

