DROP TABLE IF EXISTS `camera_deployment`;
CREATE TABLE `camera_deployment`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sequence_no` int NULL DEFAULT NULL COMMENT '序号',
  `batch_name` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '批次名称',
  `area` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '布设区域',
  `deployment_start` date NULL DEFAULT NULL COMMENT '布设开始时间',
  `deployment_end` date NULL DEFAULT NULL COMMENT '布设结束时间',
