DROP TABLE IF EXISTS `camera_return`;
CREATE TABLE `camera_return`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `borrow_id` bigint NULL DEFAULT NULL COMMENT '关联借用单ID',
  `equipment_id` bigint NOT NULL COMMENT '关联设备ID',
  `equipment_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '设备名称',
  `model` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '型号',
  `project_id` bigint NULL DEFAULT NULL COMMENT '关联项目ID',
