  `returner` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '归还/操作人员',
  `return_time` datetime NOT NULL COMMENT '归还/操作时间',
  `return_qty` int NULL DEFAULT 0 COMMENT '归还数量',
  `install_add_qty` int NULL DEFAULT 0 COMMENT '安装数量',
  `scrapped_qty` int NULL DEFAULT 0 COMMENT '报废数量',
  `stolen_qty` int NULL DEFAULT 0 COMMENT '被盗数量',
  `recovered_qty` int NULL DEFAULT 0 COMMENT '回收数量',
