-- ----------------------------
-- Table structure for camera_statistics
-- ----------------------------
DROP TABLE IF EXISTS `camera_statistics`;
CREATE TABLE `camera_statistics`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sequence_no` int NULL DEFAULT NULL COMMENT '序号',
  `area` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '布设区域',
  `storage_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '存储路径',
  `file_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '文件编号',
  `original_file_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '原始文件编号',
  `file_format` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '文件格式',
  `folder_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '文件夹编号',
  `camera_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '相机编号',
  `site_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '布设位点编号',
  `photo_date` date NOT NULL COMMENT '拍摄日期',
  `photo_time` time NOT NULL COMMENT '拍摄时间',
  `working_days` int NOT NULL COMMENT '工作天数',
  `object_category` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '对象类别',
  `species_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '物种名称',
  `animal_count` int NULL DEFAULT NULL COMMENT '动物数量',
  `gender` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '性别',
  `first_photo` int NULL DEFAULT NULL COMMENT '独立探测首张',
  `valid_photos` int NULL DEFAULT NULL COMMENT '有效照片',
  `temperature` int NULL DEFAULT NULL COMMENT '温度',
  `remarks` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 234 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '红外相机数据表';

-- ----------------------------
-- Records of camera_statistics
