-- ----------------------------
-- Table structure for field_survey
-- ----------------------------
DROP TABLE IF EXISTS `field_survey`;
CREATE TABLE `field_survey`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `equipment_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '设备名称',
  `model` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '型号',
  `price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '单价',
  `vendor` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '销售商',
  `purchase_time` datetime NULL DEFAULT NULL COMMENT '采购时间',
  `total_qty` int NULL DEFAULT 0 COMMENT '总数量(初始录入)',
  `available_qty` int NULL DEFAULT 0 COMMENT '可用数量',
  `borrowed_qty` int NULL DEFAULT 0 COMMENT '外借数量(累加所有用户)',
  `installed_qty` int NULL DEFAULT 0 COMMENT '安装数量(野外在役)',
  `scrapped_qty` int NULL DEFAULT 0 COMMENT '报废数量(历史累计)',
  `audit_status` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT '审核状态(0待审 1通过 2驳回)',
  `audit_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '驳回原因',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '创建者(学生/负责人)',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '外业调查设备表';

