  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sequence_no` int NULL DEFAULT NULL COMMENT '序号',
  `stat_month` varchar(7) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '统计月份',
  `start_date` date NOT NULL COMMENT '出发日期',
  `end_date` date NOT NULL COMMENT '返校日期',
  `location` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '外业地点',
