-- ----------------------------
-- Table structure for thesis_proposal
-- ----------------------------
DROP TABLE IF EXISTS `thesis_proposal`;
CREATE TABLE `thesis_proposal`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '序',
  `student_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '学生姓名',
  `degree_type` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '类别（硕士/博士）',
  `major` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '专业（野保、林业、生态学、环境工程）',
  `enrollment_year` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '入学年级',
  `thesis_title` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '开题题目',
  `research_direction` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '方向类别',
  `planned_proposal_date` date NULL DEFAULT NULL COMMENT '计划开题日期',
  `actual_proposal_date` date NULL DEFAULT NULL COMMENT '开题答辩日期',
  `midterm_check_date` date NULL DEFAULT NULL COMMENT '中期检查日期',
  `midterm_defense_date` date NULL DEFAULT NULL COMMENT '中期答辩日期',
  `proposal_report_url` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '开题报告（文档）',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '创建人',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '更新人',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `status` tinyint(1) NULL DEFAULT 0 COMMENT '状态（0进行中，1已完成）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '开题与学位论文表';

